CortanaConsentPanel.Description:
Jei norite, kad „Cortana“ galėtų atsakyti į jūsų klausimus, padėtų prisiminti tai, kas svarbu, ir dar daugiau, leiskite programai rinkti ir naudoti jūsų informaciją, įskaitant:

vietą ir vietų istoriją;

kontaktus, kalendoriaus informaciją ir turinį bei žinučių, tiesioginių pranešimų ir programų ryšių retrospektyvą;

ieškos istoriją bei kitą įrenginio informaciją, kad galėtų geriau pritaikyti funkcijas asmeniškai jums.
